import React from 'react';
import './roundTrip.css'

class Roundtrip extends React.Component{
  constructor(props) {
  super(props);
  this.state = {
    input: {},
    errors: {}
  };
   
  this.handleChange = this.handleChange.bind(this);
  this.handleSubmit = this.handleSubmit.bind(this);
}
   
handleChange(event) {
  let input = this.state.input;
  input[event.target.name] = event.target.value;

  this.setState({
    input
  });
}
   
handleSubmit(event) {
  event.preventDefault();
  console.log(this.state);
  let input = {};
  input["from"] = "";
  input["to"] = "";
  input["fromdate"] = "";
  input["todate"] = "";
  this.setState({input:input});
}
  render() {
    return (
        <form className="form mx-5 mt-2 pb-4" action="#">
          <div className="row">
            <div className="form-group">
              <label for={this.props.data[0].labelname} >{this.props.data[0].LabelTitle}</label>
              <input 
                type={this.props.data[0].InputType} 
                name={this.props.data[0].InputName} 
                value={this.state.input.from}
                onChange={this.handleChange}
                class="form-control" 
                placeholder={this.props.data[0].Placeholder} 
                />
            </div>
            <a className="my-auto"><i className="fas fa-exchange-alt"></i></a>
            <div className="form-group">
              <label for={this.props.data[2].labelname} >{this.props.data[2].LabelTitle}</label>
              <input 
                type={this.props.data[2].InputType} 
                name={this.props.data[2].InputName} 
                value={this.state.input.to}
                onChange={this.handleChange}
                class="form-control" 
                placeholder={this.props.data[2].Placeholder} 
                />
            </div>
          </div>
          <div className="row">
            <div className="form-group">
              <label for={this.props.data[1].labelname} >{this.props.data[1].LabelTitle}</label>
              <input 
                type={this.props.data[1].InputType} 
                name={this.props.data[1].InputName} 
                value={this.state.input.fromdate}
                onChange={this.handleChange}
                class="form-control" 
                placeholder={this.props.data[1].Placeholder} 
                />
            </div>
            <a><i className="fas fa-exchange-alt"></i></a>
            <div className="form-group">
              <label for={this.props.data[3].labelname} >{this.props.data[3].LabelTitle}</label>
              <input 
                type={this.props.data[3].InputType} 
                name={this.props.data[3].InputName} 
                value={this.state.input.todate}
                onChange={this.handleChange}
                class="form-control" 
                placeholder={this.props.data[3].Placeholder} 
                />
            </div>
          </div>
          <button>Search</button>
        </form>
      )
    }
  }
export default Roundtrip
